    return(
        <nav className="home_nav">
            <img src={logo} className="App-logo" alt="logo" />
            <ul>
                <li>Home</li>
                <li>Categories</li>
                <li>info</li>
                <li>blah blah</li>
            </ul>
        </nav>
    )
}

export default Navbar
